830),(11031,4,30,0,'','Ety/348','',9847,0,'2011-10-11 20:08:33',1,NULL,NULL,2142,NULL,0,1,0,NULL,141831),(11033,1,30,0,'','MR/329','The title Athrabeth Finrod ah Andreth is translated \n  as \"converse of Finrod and Andreth\", but some scholars actually believe this word to be \n  unrelated with the conjunction  [[a.1]] , ar \"and\", and they render it as \"with\". Other scholars consider that \"and\" and \"with\" (in the comitative sense) are not exclusive of each other, and regard ah as the form taken by this conjunction before a vowel. \n  That a, ar and ah are etymologically related has finally been confirmed in VT/43:29-30. \n  Compare also with Welsh, where the coordination \"and\" also takes different forms whether it occurs before a vowel or a consonant (respectively ac and a). In written Welsh, a often triggers the aspirate mutation: bara a chaws \"bread and cheese\". This usage is seldom applied in colloquial Welsh (Modern Welsh §510)',9848,0,'2011-10-11 20:08:34',1,NULL,NULL,1472,NULL,0,30,0,NULL,141832),(11036,1,30,0,'','LotR/I:XII','Though attested in LotR, this word might relate to  [[ae.1]] , with the regular change from ai to ae between Noldorin and Sindarin',9849,0,'2011-10-11 20:08:34',1,NULL,NULL,9848,NULL,0,12,0,NULL,141833),(11038,1,30,0,'','VT/44:21,30','',9849,0,'2011-10-11 20:08:34',1,NULL,NULL,4696,NULL,0,21,0,NULL,141834),(11040,4,30,0,'','Ety/355','',9851,0,'2011-10-11 20:08:34',1,NULL,NULL,9850,NULL,0,14,0,NULL,141835),(11042,4,30,0,'','Ety/367','',9852,0,'2011-10-11 20:08:34',1,NULL,NULL,607,NULL,0,19,0,NULL,141836),(11045,1,30,0,'','UT/40','Uncertain meaning, but compare with Quenya ela! \"imperative exclamation directing sight to an actually visible object\" (WJ/362)',9853,0,'2011-10-11 20:08:34',1,NULL,NULL,3998,NULL,0,12,0,NULL,141837),(11047,4,30,0,'','Ety/348, VT/45:5','',9854,0,'2011-10-11 20:08:34',1,NULL,NULL,1080,NULL,0,1,0,NULL,141838),(11050,4,30,0,'','Ety/348','',9856,0,'2011-10-11 20:08:34',1,NULL,NULL,1222,NULL,0,14,0,NULL