val use seems to be attested in several \n    place names (Amon Dín \"Silent Hill\", etc.), \n    though an adjective  [[dínen.1]]  is also attested\n    (Rath Dínen \"Silent Street\"). When compared with other toponyms where \n    lenition does occur (Taur-na-Chardhîn \"Forest of the Southern Silence\" \n    in WJ/185,193 and Dor Dhínen in WJ/333,338), the forms dîn and \n    dínen clearly seem to be unmutated. Absence of lenition in these \n    examples from LotR was therefore tentatively explained by resistance to \n    mutation (as in Nan Tathren, Ered Mithrin).\n    However, Tolkien apparently changed his mind in his unfinished \n    index of names from LotR, where he explains both words as mutated adjectives \n    whose unlenited forms are respectively  [[tîn.2]]  \n    and  [[tínen]] . Such hesitations between mutated and \n    unmutated forms is not unusual, for instance a similar issue is met \n    with  [[gaear]]  and  [[aear]] . \n    Of course, Taur-na-Chardhîn and Dor Dhínen would hardly be \n    explainable in that alternate scenario',10329,0,'2011-10-11 20:08:56',1,NULL,NULL,10328,NULL,0,14,0,NULL,142306),(12153,4,30,0,'','Ety/354','',10329,0,'2011-10-11 20:08:56',1,NULL,NULL,2003,NULL,0,14,0,NULL,142307),(12157,1,30,0,'','S/430, WJ/194','See also  [[dîn.1]]  for a discussion regarding this word',10331,0,'2011-10-11 20:08:56',1,NULL,NULL,10330,NULL,0,1,0,NULL,142308),(12159,4,30,0,'dî+neth','Ety/377-378','',10332,0,'2011-10-11 20:08:56',1,NULL,NULL,1548,NULL,0,14,0,NULL,142309),(12161,4,30,0,'','Ety/354, Ety/352','',10333,0,'2011-10-11 20:08:56',1,NULL,NULL,749,NULL,0,14,0,NULL,142310),(12163,1,30,0,'dîr+naith \"man spearhead\"','UT/282','',10335,0,'2011-10-11 20:08:56',1,NULL,NULL,10334,NULL,0,14,0,NULL,142311),(12166,4,30,0,'','Ety/352, Ety/375','',10337,0,'2011-10-11 20:08:56',1,NULL,NULL,1548,NULL,0,14,0,NULL,142312),(12168,4,30,0,'','Ety/355','',10338,0,'2011-10-11 20:08:56',1,NULL,NULL,2469,NULL,0,1,0,NULL,142313),(12170,4,30,0,'','Ety/376, S/43