,10369,0,'2011-10-11 20:08:58',1,NULL,NULL,6589,NULL,0,26,0,NULL,142345),(12253,1,30,0,'MS *druγ, Dr druγu','UT/385','In PE/11:31, an older Gnomish word drû, drui meant \"wood, forest\", and in PE/13:142, the early Noldorin word drú was assigned the meaning \"dark\". \n     Drû pl. Drúin later came to be used for the name of the Woses, with other derivatives (Drúadan, etc.). \n     \"Wose\" is actually the modernization of an Anglo-Saxon word wasa only found in the compound wudu-wasa \"wild man of \n     the woods\", cf. UT/385 sq. In the drafts of the \"Ride of the Rohirrim\" in WR/343-346, the Woses first appeared as \"the dark men of Eilenach\". \n     Though internally said to derive from drughu in their own tongue, Tolkien\'s choice for the Sindarin name of the Woses was \n     apparently influenced by earlier meanings assigned to this word',10370,0,'2011-10-11 20:08:58',1,NULL,NULL,749,NULL,0,14,0,NULL,142346),(12256,1,30,0,'drû+adan','UT/385','',10372,0,'2011-10-11 20:08:58',1,NULL,NULL,749,NULL,0,14,0,NULL,142347),(12259,1,30,0,'','UT/385','',10373,0,'2011-10-11 20:08:58',1,NULL,NULL,10371,NULL,0,14,0,NULL,142348),(12261,1,30,0,'drû+nos(s)','UT/385','',10375,0,'2011-10-11 20:08:58',1,NULL,NULL,10374,NULL,0,14,0,NULL,142349),(12263,1,30,0,'drû+gwaith','UT/385','',10376,0,'2011-10-11 20:08:58',1,NULL,NULL,1319,NULL,0,14,0,NULL,142350),(12264,4,30,0,'','Ety/354, S/430, VT/45:9','',10378,0,'2011-10-11 20:08:58',1,NULL,NULL,10377,NULL,0,14,0,NULL,142351),(12265,1,30,0,'','Ety/354, S/430, VT/45:9','',10378,0,'2011-10-11 20:08:58',1,NULL,NULL,10377,NULL,0,14,0,NULL,142352),(12270,4,30,0,'Either the collective plural of dû, or a compound dû+gwath \"night shade\" (hence dúwath)','Ety/354, S/430','',10380,0,'2011-10-11 20:08:58',1,NULL,NULL,1194,NULL,0,14,0,NULL,142353),(12271,1,30,0,'Either the collective plural of dû, or a compound dû+gwath \"night shade\" (hence dúwath)','Ety/354, S/430','',10380,0,'2011-10-11 20:08:58',1,NULL,NULL,1194,NULL,0,14,0,NULL,142354),(12