NULL,NULL,1862,NULL,0,1,0,NULL,142697),(13050,1,30,0,'','Curunír \'Lân UT/390','The word is deduced from its mutated form, but\n    it is worth mentioning that a stem GALÁN \"bright\", with glan \n    \"daylight\" (and later \"clear\") as derivative, is listed in the Etymologies \n    (not included in the published text, but see VT/45:13).\n    Most of the words meaning \"white\" in the Indo-Eureopean languages come \n    from the original notion of \"brightness\", e.g. Greek leukós \n    \"white\" is cognate with Latin lucere \"to shine\", lux \n    \"light\". This association of sense is also found in Gnomish, PE/11:39 \n    (glan \"clean, pure\", from \"bright\" originally) and in Early \n    Noldorin (PE/13:144, glann \"clean\"). The similarity with \n    Welsh glan (where the vowel, incidentally, is also long, though this\n    is concealed by Welsh orthographic convention) is also striking',10707,0,'2011-10-11 20:09:19',1,NULL,NULL,1451,NULL,0,1,0,NULL,142698),(13053,1,30,0,'','VT/42:8','',10707,0,'2011-10-11 20:09:19',1,NULL,NULL,1883,NULL,0,14,0,NULL,142699),(13056,1,30,0,'','Glanduin, Glanhír UT/264, UT/318, UT/441, VT/42','',10708,0,'2011-10-11 20:09:19',1,NULL,NULL,1879,NULL,0,14,0,NULL,142700),(13058,1,30,0,'','Glanduin, Glanhír UT/264, UT/318, UT/441, VT/42','',10709,0,'2011-10-11 20:09:19',1,NULL,NULL,1879,NULL,0,14,0,NULL,142701),(13060,1,30,0,'gland+tagol','VT/42:8,28','',10710,0,'2011-10-11 20:09:19',1,NULL,NULL,7963,NULL,0,14,0,NULL,142702),(13062,4,30,0,'','Ety/357','',1304,0,'2011-10-11 20:09:19',1,NULL,NULL,2816,NULL,0,14,0,NULL,142703),(13064,4,30,0,'','Ety/357','',10711,0,'2011-10-11 20:09:19',1,NULL,NULL,2816,NULL,0,14,0,NULL,142704),(13066,4,30,0,'','Ety/358, Ety/368','',10712,0,'2011-10-11 20:09:19',1,NULL,NULL,2265,NULL,0,14,0,NULL,142705),(13068,4,30,0,'','Ety/358, Ety/368','',10713,0,'2011-10-11 20:09:19',1,NULL,NULL,2265,NULL,0,14,0,NULL,142706),(13070,4,30,0,'','Ety/358','',10715,0,'2011-10-11 20:09:20',1,NULL,NULL,10714,NULL,0,26,0,NUL