 as \n     anybody remembered, he had always looked much the same, old but very vigorous\"',11040,0,'2011-10-11 20:09:35',1,NULL,NULL,11039,NULL,0,1,0,NULL,143022),(13823,1,30,0,'','S/433, WJ/370, WJ/378','',11042,0,'2011-10-11 20:09:36',1,NULL,NULL,2199,NULL,0,14,0,NULL,143023),(13825,1,30,0,'','S/433, WJ/370, WJ/378','',11043,0,'2011-10-11 20:09:36',1,NULL,NULL,2199,NULL,0,14,0,NULL,143024),(13827,1,30,0,'iâth+rim','WJ/378','',11044,0,'2011-10-11 20:09:36',1,NULL,NULL,4367,NULL,0,14,0,NULL,143025),(13829,4,30,0,'','Ety/399','',11045,0,'2011-10-11 20:09:36',1,NULL,NULL,10214,NULL,0,14,0,NULL,143026),(13831,4,30,0,'','Ety/400, VT/46:22','',11045,0,'2011-10-11 20:09:36',1,NULL,NULL,373,NULL,0,14,0,NULL,143027),(13835,4,30,0,'Q yána','Ety/400','',11046,0,'2011-10-11 20:09:36',1,NULL,NULL,2714,NULL,0,14,0,NULL,143028),(13838,4,30,0,'','Ety/358, Ety/399, S/433, UT/384','',11047,0,'2011-10-11 20:09:36',1,NULL,NULL,9628,NULL,0,1,0,NULL,143029),(13839,1,30,0,'','Ety/358, Ety/399, S/433, UT/384','',11047,0,'2011-10-11 20:09:36',1,NULL,NULL,9628,NULL,0,1,0,NULL,143030),(13840,4,30,0,'','Ety/358, Ety/399, S/433, UT/384','',11047,0,'2011-10-11 20:09:36',1,NULL,NULL,9628,NULL,0,1,0,NULL,143031),(13841,1,30,0,'','Ety/358, Ety/399, S/433, UT/384','',11047,0,'2011-10-11 20:09:36',1,NULL,NULL,9628,NULL,0,1,0,NULL,143032),(13846,1,30,0,'','LotR/D','',11049,0,'2011-10-11 20:09:36',1,NULL,NULL,10403,NULL,0,14,0,NULL,143033),(13849,1,30,0,'','WJ/403','',11050,0,'2011-10-11 20:09:36',1,NULL,NULL,243,NULL,0,14,0,NULL,143034),(13852,1,30,0,'','Ety/361, X/Z','',11052,0,'2011-10-11 20:09:36',1,NULL,NULL,11051,NULL,0,14,0,NULL,143035),(13854,4,30,0,'','Ety/361, X/Z','',11053,0,'2011-10-11 20:09:36',1,NULL,NULL,11051,NULL,0,14,0,NULL,143036),(13856,4,30,0,'','Ety/361','',11055,0,'2011-10-11 20:09:36',1,NULL,NULL,11054,NULL,0,1,0,NULL,143037),(13860,1,30,0,'în+rind','Ety/383, Ety/400, X/ND4','',11057,0,'2011-10-11 20:09:36',1,NULL,NULL,2408,NULL,0,14,0,NULL,143038),(13862,4,30,0,'în+rind','Ety