).\n    Likewise, the Qenyaqetsa included a root NURU- with several derivatives with similar meanings (PE/12:68). \n    See also Q. nurrula \"mumbling\" (from nurru- \"murmur, grumble\") in the final version of the poem The Last Ark (MC/222-23).\n    Patrick Wynne therefore noted: S. *nûr in Núrnen \"Sad Water\"\n    is apparently \"sad\" in the sense \"bewailing, lamenting, complaining, grumbling\", no doubt a reference to the general mood of \n    the hapless laborers in \"the great slave-worked fields\" beside the lake. (See Lambengolmor/856-860)',11634,0,'2011-10-11 20:10:16',1,NULL,NULL,10315,NULL,0,1,0,NULL,143661),(15322,1,30,0,'','Ety/387, X/IU','',11636,0,'2011-10-11 20:10:16',1,NULL,NULL,11635,NULL,0,14,0,NULL,143662),(15324,4,30,0,'','Ety/387, X/IU','',11637,0,'2011-10-11 20:10:16',1,NULL,NULL,11635,NULL,0,14,0,NULL,143663),(15326,4,30,0,'','Ety/360, WJ/366, WJ/369-70, LotR/II:IV, SD/129-3','According to WJ/366, the preposition \"is normally o in all positions, though od appears occasionally before vowels, especially before o-\". With a suffixed article, see also  [[uin]]',6201,0,'2011-10-11 20:10:16',1,NULL,NULL,1040,NULL,0,20,0,NULL,143664),(15327,1,30,0,'','Ety/360, WJ/366, WJ/369-70, LotR/II:IV, SD/129-3','According to WJ/366, the preposition \"is normally o in all positions, though od appears occasionally before vowels, especially before o-\". With a suffixed article, see also  [[uin]]',6201,0,'2011-10-11 20:10:16',1,NULL,NULL,1040,NULL,0,20,0,NULL,143665),(15330,1,30,0,'','Ety/360, WJ/366, WJ/369-70, LotR/II:IV, SD/129-3','According to WJ/366, the preposition \"is normally o in all positions, though od appears occasionally before vowels, especially before o-\". With a suffixed article, see also  [[uin]]',11638,0,'2011-10-11 20:10:16',1,NULL,NULL,1040,NULL,0,20,0,NULL,143666),(15333,4,30,0,'','Ety/378','The Etymologies state that h- is prefixed to the word following this preposition, when it begins with a vowel: o Hedhil \"concerning the Elves\". Some scholars consider that this rule is not valid in Sindarin, but that the preposition would perhaps  become oh in such a case (hence oh Edhil, to be compared with  [[ah]]  in Athrabeth Finrod ah Andreth)',6201,0,'2011-10-11 20:10:16',1,NULL,NULL,11639,NULL,0,20,0,NULL,143667),(15336,1,30,0,'','VT/47:42','',11640,0,'2011-10-11 20:10:16',1,NULL,NULL,6551,NULL,0,15,0,NULL,143668),(15338,1,30,0,'','WJ/364, WJ/366, WJ/378-379','',11641,0,'2011-10-11 20:10:16',1,NULL,NULL,4367,NULL,0,14,0,NULL,143669),(15340,1,30,0,'ódhel+rim','WJ/364','',11642,0,'2011-10-11 20:10:16',1,NULL,NULL,4367,NULL,0,14,0,NULL,143670),(15342,4,30,0,'','Ety/379','',11643,0,'2011-10-11 20:10:16',1,NULL,NULL,6008,NULL,0,14,0,NULL,143671),(15344,4,30,0,'','Ety/379','',11644,0,'2011-10-11 20:10:16',1,NULL,NULL,6008,NULL,0,14,0,NULL,143672),(15346,4,30,0,'','Ety/379, VT/42:25, VT/47:42, VT/48:6, PE/17:95','',11645,0,'2011-10-11 20:10:16',1,NULL,NULL,6556,NULL,0,5,0,NULL,143673),(15347,1,30,0,'','Ety/379, VT/42:25, VT/47:42, VT/48:6, PE/17:95','',11645,0,'2011-10-11 20:10:16',1,NULL,NULL,6556,NULL,0,5,0,NULL,143674),(15349,1,30,0,'','Ety/379, VT/42:25, VT/47:42, VT/48:6, PE/17:95','',11646,0,'2011-10-11 20:10:16',1,NULL,NULL,6556,NULL,0,5,0,NULL,143675),(15351,1,30,0,'','TI/312, WR/436, VT/42:25','',11647,0,'2011-10-11 20:10:16',1,NULL,NULL,6551,NULL,0,15,0,NULL,143676),(15353,1,30,0,'','VT/48:32','',11648,0,'2011-10-11 20:10:16',1,NULL,NULL,6293,NULL,0,1,0,NULL,143677),(15356,4,30,0,'','Ety/370, Ety/379','',11649,0,'2011-10-11 20:10:17',1,NULL,NULL,1949,NULL,0,14,0,NULL,143678),(15358,4,30,0,'','Ety/396','',11651,0,'2011-10-11 20:10:17',1,NULL,NULL,11650,NULL,0,14,0,NULL,143679),(15360,4,30,0,'','Ety/396','',87,0,'2011-10-11 20:10:17',1,NULL,NULL,11650,NULL,0,14,0,NULL,143680),(15362,4,30,0,'','Ety/370, Ety/379','',11652,0,'2011-10-11 20:10:17',1,NULL,NULL,1949,NULL,0,26,0,NULL,143681),(15364,1,30,0,'','LotR/A(v)','Written onen in some editions of LotR. \n  In the Qenyaqetsa, Qenya anta- is marked as having an irregular\n  past tense áne. Assuming the same sound-shifts as observed in other\n  words, this would indeed lead to onen in Sindarin, see PE/12:31 and TT/14:48-49',11653,0,'2011-10-11 20:10:17',1,NULL,NULL,1319,NULL,0,14,0,NULL,143682),(15365,1,30,0,'','besoneth PM/404-05','',11654,0,'2011-10-11 20:10:17',1,NULL,NULL,3196,NULL,0,14,0,NULL,143683),(15367,1,30,0,'','Abonnen, Eboennin WJ/387','',11655,0,'2011-10-11 20:10:17',1,NULL,NULL,6000,NULL,0,26,0,NULL,143684),(15369,1,30,0,'','Abonnen, Eboennin WJ/387','',11656,0,'2011-10-11 20:10:17',1,NULL,NULL,10039,NULL,0,14,0,NULL,143685),(15371,1,30,0,'','LotR/F, Letters/224','',11658,0,'2011-10-11 20:10:17',1,NULL,NULL,11657,NULL,0,14,0,NULL,143686),(15373,1,30,0,'onod+rim','Letters/224, TC/165','',11659,0,'2011-10-11 20:10:17',1,NULL,NULL,11657,NULL,0,14,0,NULL,143687),(15375,4,30,0,'','Ety/379','',837,0,'2011-10-11 20:10:17',1,NULL,NULL,11660,NULL,0,20,0,NULL,143688),(15378,4,30,0,'','Ety/379','',6427,0,'2011-10-11 20:10:17',1,NULL,NULL,11660,NULL,0,19,0,NULL,143689),(15381,1,30,0,'aur+aearon','LotR/D','',11661,0,'2011-10-11 20:10:17',1,NULL,NULL,1369,NULL,0,14,0,NULL,143690),(15383,1,30,0,'aur+anor','LotR/D','',11662,0,'2011-10-11 20:10:17',1,NULL,NULL,1369,NULL,0,14,0,NULL,143691),(15385,1,30,0,'aur+belain','LotR/D','',11663,0,'2011-10-11 20:10:17',1,NULL,NULL,1369,NULL,0,14,0,NULL,143692),(15387,4,30,0,'','Ety/379, LR/406, WJ/390, LotR/II:VI, LotR/F, Let','',11665,0,'2011-10-11 20:10:17',1,NULL,NULL,11664,NULL,0,14,0,NULL,143693),(15388,1,30,0,'','Ety/379, LR/406, WJ/390, LotR/II:VI, LotR/F, Let','',11665,0,'2011-10-11 20:10:17',1,NULL,NULL,11664,NULL,0,14,0,NULL,143694),(15391,4,30,0,'or+hall, OS *orkʰalla','Ety/363, Ety/379, WJ/305','In his article Probable errors in the Etymologies, Helge Fauskanger lists orchel as a misreading, following Christopher Tolkien\'s note admitting that the e is uncertain.\n  However, though orchal is  attested in WJ/305, it does not necessarily mean that the form orchel is incorrect. It might be constructed by analogy with words such as  [[hathol]]  \"axe\" (from WJ/234 and the name of a Númenórean, Hatholdir, UT:444), which is also found as hathal (in Hathaldir, name of a companion of Barahir, LR/433, untranslated but conceivably cognate) and hathel (LR/389). \n  Without entering into the details, such words end with a syllabic consonant (as in English \"people\"), and several vocalizations\n  are apparently possible in Sindarin. The epenthetical vowel is generally o, but it seems that a or e are also allowed. \n  Regarding orchal, its origin is of course different, as it is a compound word where the second element clearly derives\n  from KHAL, but it may have been assimilated, later, to this class of words by analogy.\n  We may therefore consider that orchel is a perfectly valid dialectal variant',11667,0,'2011-10-11 20:10:17',1,NULL,NULL,11666,NULL,0,1,0,NULL,143695),(15392,1,30,0,'or+hall, OS *orkʰalla','Ety/363, Ety/379, WJ/305','In his article Probable errors in the Etymologies, Helge Fauskanger lists orchel as a misreading, following Christopher Tolkien\'s note admitting that the e is uncertain.\n  However, though orchal is  attested in WJ/305, it does not necessarily mean that the form orchel is incorrect. It might be constructed by analogy with words such as  [[hathol]]  \"axe\" (from WJ/234 and the name of a Númenórean, Hatholdir, UT:444), which is also found as hathal (in Hathaldir, name of a companion of Barahir, LR/433, untranslated but conceivably cognate) and hathel (LR/389). \n  Without entering into the details, such words end with a syllabic consonant (as in English \"people\"), and several vocalizations\n  are apparently possible in Sindarin. The epenthetical vowel is generally o, but it seems that a or e are also allowed. \n  Regarding orchal, its origin is of course different, as it is a compound word where the second element clearly derives\n  from KHAL, but it may have been assimilated, later, to this class of words by analogy.\n  We may therefore consider that orchel is a perfectly valid dialectal variant',11667,0,'2011-10-11 20:10:17',1,NULL,NULL,11666,NULL,0,1,0,NULL,143696),(15393,4,30,0,'or+hall, OS *orkʰalla','Ety/363, Ety/379, WJ/305','In his article Probable errors in the Etymologies, Helge Fauskanger lists orchel as a misreading, following Christopher Tolkien\'s note admitting that the e is uncertain.\n  However, though orchal is  attested in WJ/305, it does not necessarily mean that the form orchel is incorrect. It might be constructed by analogy with words such as  [[hathol]]  \"axe\" (from WJ/234 and the name of a Númenórean, Hatholdir, UT:444), which is also found as hathal (in Hathaldir, name of a companion of Barahir, LR/433, untranslated but conceivably cognate) and hathel (LR/389). \n  Without entering into the details, such words end with a syllabic consonant (as in English \"people\"), and several vocalizations\n  are apparently possible in Sindarin. The epenthetical vowel is generally o, but it seems that a or e are also allowed. \n  Regarding orchal, its origin is of course different, as it is a compound word where the second element clearly derives\n  from KHAL, but it may have been assimilated, later, to this class of words by analogy.\n  We may therefore consider that orchel is a perfectly valid dialectal variant',11667,0,'2011-10-11 20:10:17',1,NULL,NULL,11666,NULL,0,1,0,NULL,143697),(15394,1,30,0,'or+hall, OS *orkʰalla','Ety/363, Ety/379, WJ/305','In his article Probable errors in the Etymologies, Helge Fauskanger lists orchel as a misreading, following Christopher Tolkien\'s note admitting that the e is uncertain.\n  However, though orchal is  attested in WJ/305, it does not necessarily mean that the form orchel is incorrect. It might be constructed by analogy with words such as  [[hathol]]  \"axe\" (from WJ/234 and the name of a Númenórean, Hatholdir, UT:444), which is also found as hathal (in Hathaldir, name of a companion of Barahir, LR/433, untr