bit, and was finally placed North-West of the Sea of Rhûn in the \n    decorated map by Pauline Baynes (see HL/115-117 for discussion). The meaning of this\n    name is unknown and has been largely discussed. What do we have indeed in this \"Winion\", \n    or rather gwinion since the initial w- must come from lenition? According to \n    Christopher Tolkien, the Lay was begun c. 1918 and was composed during his\n    father\'s stay at Leeds, a date meaning that the word can be Gnomish, possibly Early \n    Noldorin, or in an indigenous language of Beleriand. In Gnomish and later in Doriathrin \n    and Ilkorin, there is a genitive plural ending -ion which may very well be \n    contained in this word. Then we would segment gwin-ion \"of gwin\". \n    The context calls for \"wine\", \"vine\" or something similar. It can hardly be a coincidence that \n    gwin is precisely the Welsh word for \"wine\", a loan from the Latin vinum,\n    as the English \"wine\" itself',10876,0,'2017-05-12 23:56:40',1,NULL,NULL,10875,'2017-05-12 23:56:40',1,14,0,NULL,155278),(250750,4,30,0,'','Dorwinion LotR/Map, LB/11,26,17,112, LR/334,338,','The wine of Dor-Winion occurs in the Lay of the children of Húrin\n    and a place located either in the \"burning South\" in the first version, or probably\n    east of the Blue Mountains in the second. Then we have Dorwinion as a \n    meadow-land in Tol Eressëa at the end of the Quenta Silmarillion. It reappears\n    in The Hobbit, and was finally placed North-West of the Sea of Rhûn in the \n    decorated map by Pauline Baynes (see HL/115-117 for discussion). The meaning of this\n    name is unknown and has been largely discussed. What do we have indeed in this \"Winion\", \n    or rather gwinion since the initial w- must come from lenition? According to \n    Christopher Tolkien, the Lay was begun c. 1918 and was composed during his\n    father\'s stay at Leeds, a date meaning that the word can be Gnomish, possibly Early \n    Noldorin, or in an indigenous language of Beleriand. In Gnomish and later in Doriathrin \n    and Ilkorin, there is a genitive plural ending -ion which may very well be \n    contained in this word. Then we would segment gwin-ion \"of gwin\". \n    The context calls for \"wine\", \"vine\" or something similar. It can hardly be a coincidence that \n    gwin is precisely the Welsh word for \"wine\", a loan from the Latin vinum,\n    as the English \"wine\" itself',10876,0,'2017-05-12 23:58:47',1,NULL,NULL,10875,'2017-05-12 23:58:47',1,14,0,NULL,155279);
